description:
Michelle Austin is back on the prowl in her latest Trans Men Adventures 2: Men At Work. She finds her way around getting into trouble with some of the hottest trans men workers. She meets a handyman, a plumber, a pool boy and a pizza boy. If you've seen TMA 1 you know what happens, she fucks them all! Featuring Michelle Austin, Dicky Johnson, Parker Reed, Chance Armstrong and introducing Eddie Wood. There are four separate very good in-depth interviews of the trans men showcased in this film. They are must-see material. I also enjoyed the outtakes/bloopers footage and nice looking photos.

